package com.google.zxing.oned;


import org.junit.Assert;
import org.junit.Test;


/**
 *
 *
 * @author Michael Jahn
 */
public final class Code39ExtendedModeTestCase extends Assert {
    @Test
    public void testDecodeExtendedMode() throws Exception {
        Code39ExtendedModeTestCase.doTest("\u0000\u0001\u0002\u0003\u0004\u0005\u0006\u0007\b\t\n\u000b\f\r\u000e\u000f\u0010\u0011\u0012\u0013\u0014\u0015\u0016\u0017\u0018\u0019\u001a\u001b\u001c\u001d\u001e\u001f", "");
        Code39ExtendedModeTestCase.doTest(" !\"#$%&\'()*+,-./0123456789:;<=>?", "");
        Code39ExtendedModeTestCase.doTest("@ABCDEFGHIJKLMNOPQRSTUVWXYZ[\\]^_", "");
        Code39ExtendedModeTestCase.doTest("`abcdefghijklmnopqrstuvwxyz{|}~", "");
    }
}

